import React from 'react';

const Index = () => {

    return (
        <>
            <section className="overview-block-ptb blue-bg text-center">
                <div className="container">
                    <div className="row">
                        <div className="col-sm-12">
                            <h3 className="iq-tw-7 iq-mb-20 iq-font-white">Build your own design system with Sofbox</h3>
                            <h6 className="iq-font-white iq-mb-30">Interested in making custom websites as per your needs. Contact with us today!
                            </h6>
                            <a href="#" className="button bt-black">Let's Started</a>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Index;
